import React from 'react';
import { Container, Row, Col } from 'react-bootstrap';

const About = () => {
  return (
    <Container>
      <Row>
        <Col>
          <h1 className="" >deathroll</h1>
        </Col>
      </Row>
    </Container>
  );
}

export default About;
